import React from "react";
import "./about.css";
import Pic1 from "../../image/pic1.jpg";

const About = () => {
  return (
    <div className="a">
      <div className="a-left">
        <div className="a-card bg"></div>
        <div className="a-card">
          <img
            src="https://images.unsplash.com/photo-1643228692498-7ff94a46eacc?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=987&q=80"
            alt=""
            className="a-img"
          />
        </div>
      </div>
      <div className="a-right">Right</div>
    </div>
  );
};

export default About;
